    methods (Access = public)
        function J = motor_jacobian(this, joint10)
            k = this.gainK;
            
            J = zeros(this.joints, this.motors);
            J(1,1) = k(1);
            J(2,2) = k(2);
            J(3,3) = k(3);
            J(4,4) = k(4) / cos(joint10(4));
            J(5,4) = J(4,4);
           
            J(6, 5) = k(5) / (cos(joint10(6)) * cos(joint10(7)));
            J(6, 6) = k(6) * sin(joint10(6)) * sin(joint10(7)) / (cos(joint10(6)) * pow2(cos(joint10(7))));
            
            J(7, 6) = k(6) / cos(joint10(7));
            J(8, 6) = J(7, 6);
            
            J(9, 5) = J(6, 5);
            J(9, 6) = J(6, 6);
            
            J(10,7) = k(7);            
        end
        
        function joint10 = joint7to10(~, joint7)
            if size(joint7,1) ~= 7
                error("wrong input size")
            end
                        
            joint10(1:4,:) = joint7(1:4,:);
            joint10(5,:) = joint7(4,:);
            joint10(6,:) = joint7(5,:); joint10(9,:) = joint7(5,:);
            joint10(7,:) = joint7(6,:); joint10(8,:) = joint7(6,:);
            joint10(10,:) = joint7(7,:);            
        end
        
        function joint7 = joint10to7(~, joint10)
            if size(joint10,1) ~= 10
                error("wrong input size")
            end
            
            joint7(1:4,:) = joint10(1:4,:);
            joint7(5,:) = joint10(6,:);
            joint7(6,:) = joint10(7,:);
            joint7(7,:) = joint10(10,:);
        end
        
        function jointpos = MotorToJointPos(this, motorpos)
            k = this.gainK;
            jointpos = zeros(10, size(motorpos, 2));
            
            jointpos(1, :) = k(1) * motorpos(1, :);
            jointpos(2, :) = k(2) * motorpos(2, :);
            jointpos(3, :) = k(3) * motorpos(3, :);
            jointpos(4, :) = asin(k(4) * motorpos(4, :));
            jointpos(5, :) = jointpos(4, :);
            
            jointpos(7, :) = asin(k(6) * motorpos(6, :));
            jointpos(8, :) = jointpos(7, :);
            
            jointpos(6, :) = asin(k(5) * motorpos(5, :) ./ cos(jointpos(7, :))) ;
            jointpos(9, :) = jointpos(6, :);
            
            jointpos(10, :) = k(7) * motorpos(7, :);
        end
        
        function [jointpos, jointvel, jointacc] = MotorToJoint(this, motorpos, motorvel, motoracc)
            k = this.gainK;
            
            % pos
            jointpos = zeros(10, size(motorpos, 2));

            jointpos(1, :) = k(1) * motorpos(1, :);
            jointpos(2, :) = k(2) * motorpos(2, :);
            jointpos(3, :) = k(3) * motorpos(3, :);
            jointpos(4, :) = asin(k(4) * motorpos(4, :));
            jointpos(5, :) = jointpos(4, :);
            
            jointpos(7, :) = asin(k(6) * motorpos(6, :));
            jointpos(8, :) = jointpos(7, :);
            
            jointpos(6, :) = asin(k(5) * motorpos(5, :) ./ cos(jointpos(7, :))) ;
            jointpos(9, :) = jointpos(6, :);
            
            jointpos(10, :) = k(7) * motorpos(7, :);
            
            % vel
            if nargout >= 2
                jointvel = zeros(10, size(motorpos, 2));
                
                for i = 1 : 3
                    jointvel(i, :) = motorvel(i, :) * k(i);
                end
                jointvel(4, :) = motorvel(4, :) * k(4) ./ cos(jointpos(4, :));
                jointvel(5, :) = jointvel(4, :);
                
                jointvel(7, :) = motorvel(6, :) * k(6) ./ cos(jointpos(7, :));
                jointvel(8, :) = jointvel(7, :);
                
                jointvel(6, :) = ( (motorvel(5, :)*k(5)) + (jointvel(7, :).*sin(jointpos(6, :)).*sin(jointpos(7, :))) ) ...
                                    ./ (cos(jointpos(6, :)) .* cos(jointpos(7, :)));
                jointvel(9, :) = jointvel(6, :);
                            
                jointvel(10, :) = motorvel(7, :) * k(7);
            end
            
            % acc
            if nargout >=3 
                jointacc = zeros(10, size(motorpos, 2));
                
                for i = 1:3
                    jointacc(i,:) = motoracc(i,:) * k(i);
                end
                jointacc(4,:) = ( motoracc(4,:)*k(4) + sin(jointpos(4,:)).*jointvel(4,:) ) ./ cos(jointpos(4,:));
                jointacc(5,:) = jointacc(4, :);
                
                jointacc(7,:) = ( motoracc(6,:)*k(6) + sin(jointpos(7,:)).*jointvel(7,:) ) ./ cos(jointpos(7,:));
                jointacc(8,:) = jointacc(7, :);
                
                jointacc(6,:) = ( motoracc(5,:)*k(5) + k(5)*tan(jointpos(6,:)).*motorvel(5,:).*jointvel(6,:) + k(5)*tan(jointpos(7,:)).*motorvel(5,:).*jointvel(7,:) ... 
                                    + jointacc(7,:).*sin(jointpos(6,:)).*sin(jointpos(7,:)) + ((sin(jointpos(7,:))./cos(jointpos(6,:))) + (sin(jointpos(6,:))./cos(jointpos(7,:)))).*jointvel(7,:))./(cos(jointpos(6,:)).*cos(jointpos(7,:)));
                jointacc(9,:) = jointacc(6, :);
                                
                jointacc(10,:) = motoracc(7,:) * k(7);
            end
        end
        
        function motorpos = JointToMotorPos(this, jointpos)
            k = this.gainK;
            motorpos = zeros(7, size(jointpos, 2));

            for j = 1 : 3
                motorpos(j, :) = jointpos(j, :) / k(j);
            end
            motorpos(4, :) = sin(jointpos(4, :)) / k(4);
            motorpos(6, :) = sin(jointpos(6, :)) / k(6);
            motorpos(5, :) = sin(jointpos(5, :)) .* cos(jointpos(6, :)) / k(5);
            motorpos(7, :) = jointpos(7, :) / k(7);
        end
        
        function motorvel = JointToMotorVel(this, jointpos, jointvel)
            k = this.gainK;
            motorvel = zeros(7, size(jointvel, 2));
            
            for i = 1 : 3
                motorvel(i, :) = jointvel(i, :) / k(i);
            end
            motorvel(4, :) = jointvel(4, :) .* cos(jointpos(4, :)) / k(4);
            motorvel(5, :) = (jointvel(5, :) .* cos(jointpos(5, :)) .* cos(jointpos(6, :)) - jointvel(6, :) .* sin(jointpos(5, :)) .* sin(jointpos(6, :)) ) / k(5);
            motorvel(6, :) = jointvel(6, :) .* cos(jointpos(6, :)) / k(6);
            motorvel(7, :) = jointvel(7, :) / k(7);
        end
        
    end
end